import React from "react";
import fairyDreamImage from "../../imgs/fairyTaleDream.webp";
import loginPageImage from "../../../pictures/loginPage.png";
import journalEntriesImage from "../../../pictures/journalentries.png";
import newJournalEntryImage from "../../../pictures/newJournalEntry.png";
import journalAnalysesImage from "../../../pictures/journalanalyses.png";
import "./main.css";

function Main() {
  return (
    <section className="container main-excerpt-wrapper">
      <section className="row align-items-center my-5">
        <img src={fairyDreamImage} alt="Dream Clouds" className="main-img" />
        <section className="col-lg-5">
          <h1 className="font-weight-light">Welcome to Smart Dream Journal!</h1>
          <p>Register a new account to start logging your dreams today</p>
        </section>
      </section>
      <img src={loginPageImage} alt="Login Page" className="main-img" />
    </section>
  );
}

export default Main;
